import background from 'images/arcadia.jpg'
import '../../App.css';

function AboutUs() {
  return <div style={{
    backgroundImage: `url(${background})`
  }}>
    <h1 className='aboutus'>
      About Us
    </h1>
  </div>

    ;
}

export default AboutUs;
